0afc284c83cca58f2326e10aab586ccf:
query searchInputLabelSuggestionsQuery(
  $owner: String!
  $repo: String!
) {
  repository(owner: $owner, name: $repo) {
    ...searchInputLabelSuggestionsPaginated
    id
  }
}

fragment searchInputLabel on Label {
  id
  color
  name
  nameHTML
  description
}

fragment searchInputLabelSuggestionsPaginated on Repository {
  labels(first: 100) {
    edges {
      node {
        ...searchInputLabel
        id
        __typename
      }
      cursor
    }
    totalCount
    pageInfo {
      endCursor
      hasNextPage
    }
  }
  id
}

